import React, { useState, useEffect } from 'react';
import {
  Container,
  Typography,
  Box,
  Paper,
  CircularProgress,
  Alert,
  Grid
} from '@mui/material';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
} from 'chart.js';
import { Line } from 'react-chartjs-2';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend
);

interface AnalysisData {
  entropy?: number;
  patterns?: any[];
  prediction?: {
    nextSymbol: number;
    confidence: number;
  };
  markovChain?: {
    matrix: any;
    predictability: number;
  };
}

const AnalysisPage: React.FC = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [sequences, setSequences] = useState<any[]>([]);
  const [analysisData, setAnalysisData] = useState<AnalysisData>({});

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        setError(null);
        const response = await fetch('http://localhost:5000/api/sequences/1');
        const data = await response.json();

        // Validate sequences data
        if (!data || !Array.isArray(data.symbols)) {
          console.error('Invalid sequence data received:', data);
          setError('Invalid data format received from server');
          setSequences([]);
          return;
        }

        setSequences(data.symbols);

        // Validate analysis data
        if (data.analysis) {
          setAnalysisData(data.analysis);
        } else {
          console.warn('No analysis data received');
          setAnalysisData({});
        }
      } catch (err) {
        console.error('Error fetching analysis data:', err);
        setError('Failed to fetch analysis data');
      } finally {
        setLoading(false);
      }
    };

    fetchData();
    const interval = setInterval(fetchData, 2000);
    return () => clearInterval(interval);
  }, []);

  const renderChart = () => {
    if (!Array.isArray(sequences) || sequences.length === 0) {
      return <Alert severity="info">No sequence data available yet.</Alert>;
    }

    const chartData = {
      labels: sequences.map((_, index) => index + 1),
      datasets: [
        {
          label: 'Symbol Values',
          data: sequences.map(s => s.symbol),
          borderColor: 'rgb(75, 192, 192)',
          tension: 0.1
        }
      ]
    };

    const options = {
      responsive: true,
      plugins: {
        legend: {
          position: 'top' as const,
        },
        title: {
          display: true,
          text: 'Sequence Pattern'
        }
      }
    };

    return <Line data={chartData} options={options} />;
  };

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="200px">
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Container>
        <Alert severity="error" sx={{ mt: 2 }}>
          {error}
        </Alert>
      </Container>
    );
  }

  return (
    <Container>
      <Typography variant="h4" gutterBottom sx={{ mt: 4 }}>
        Analysis Dashboard
      </Typography>

      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper elevation={3} sx={{ p: 3 }}>
            <Typography variant="h6" gutterBottom>
              Sequence Overview
            </Typography>
            {sequences.length === 0 ? (
              <Alert severity="info">No sequences recorded yet. Add some symbols in the Game page.</Alert>
            ) : (
              <Typography>
                Total Symbols: {sequences.length}
              </Typography>
            )}
          </Paper>
        </Grid>

        <Grid item xs={12}>
          <Paper elevation={3} sx={{ p: 3 }}>
            <Typography variant="h6" gutterBottom>
              Pattern Visualization
            </Typography>
            {renderChart()}
          </Paper>
        </Grid>

        {analysisData.markovChain && (
          <Grid item xs={12} md={6}>
            <Paper elevation={3} sx={{ p: 3 }}>
              <Typography variant="h6" gutterBottom>
                Markov Chain Analysis
              </Typography>
              <Typography>
                Predictability Score: {(analysisData.markovChain.predictability * 100).toFixed(2)}%
              </Typography>
            </Paper>
          </Grid>
        )}

        {analysisData.entropy !== undefined && (
          <Grid item xs={12} md={6}>
            <Paper elevation={3} sx={{ p: 3 }}>
              <Typography variant="h6" gutterBottom>
                Entropy Analysis
              </Typography>
              <Typography>
                Entropy Score: {analysisData.entropy.toFixed(3)}
              </Typography>
            </Paper>
          </Grid>
        )}

        {analysisData.prediction && (
          <Grid item xs={12}>
            <Paper elevation={3} sx={{ p: 3 }}>
              <Typography variant="h6" gutterBottom>
                Next Symbol Prediction
              </Typography>
              <Typography>
                Predicted Symbol: {analysisData.prediction.nextSymbol}
                <br />
                Confidence: {(analysisData.prediction.confidence * 100).toFixed(2)}%
              </Typography>
            </Paper>
          </Grid>
        )}
      </Grid>
    </Container>
  );
};

export default AnalysisPage;
